function bitmapScale(bitmap,x,y){
var matrix = new Matrix();  
    matrix.postScale(x/bitmap.getWidth(),y/bitmap.getHeight());
    return Bitmap.createBitmap(bitmap, 0, 0,bitmap.getWidth(),bitmap.getHeight() , matrix,true);
}

